    "2013-03-19T00:32:16.018214",nt"name": "reconnaissance-interpretation-of-1978-1981-permafrost-alaska-highway-corridor-tetlin-junction-t",nt"isopen":
    false,nt"url": null,nt"notes": "During 2009 the Alaska Division of Geological
    & Geophysical Surveys (DGGS) conducted reconnaissance interpretive mapping of permafrost
    in Alaska Highway Corridor Segment 3, a 12-mi-wide (19.3-km-wide) corridor that
    straddles the Alaska Highway through the Northway-Tanacross Lowland and the southern
    Yukon-Tanana Upland from Tetlin Junction to the Canada border. This work was an
    extension of permafrost mapping done in Alaska Highway Corridor Segment 1 from Delta
    Junction to Dot Lake in the Big Delta and Mt. Hayes Quadrangles during 2006-2007
    and Alaska Highway Corridor Segment 2 from the Robertson River to Tetlin Junction
    in the Tanacross Quadrangles during 2008. Primarily, we inferred the extent of permafrost
    and ice content by interpreting ~1:65,000-scale, false-color infrared aerial photographs
    taken in July 1978 and August 1981.",nt"license_title": null,nt"extras":
